import React from "react";
import "./SingleRoute.css";

function SingleRoute({ data }) {
  return (
    <div className="SingleRoute">
      <div>
        {data?.map((el) => (
          <div key={el._id} className="card">
            <div className="card__image">
              <img src={el.url} alt="rasm" />
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default SingleRoute;
